local Players = game:GetService("Players")
local player = Players.LocalPlayer
-- jika dijalankan di server, skip (agar aman)
if not player then
    -- server-side script: skip waiting
else
    local hv = player:FindFirstChild("HasAccess")
    if not hv then
        hv = Instance.new("BoolValue")
        hv.Name = "HasAccess"
        hv.Value = false
        hv.Parent = player
    end
    -- tunggu sampai HasAccess true
    while not hv.Value do
        wait(0.35)
    end
end
